export const AllcustContext=createContext();
export const AllcustProvider=props=>{
    const {details,setDetails}=useState([])



    return(
        <AllcustContext.Provider value={{details,setDetails}}>
            {props.children}
        </AllcustContext.Provider>
    )
}
